`httpie.http -`<kbd>TAB</kbd><kbd>TAB</kbd>
@BoboTiG can you please verify once.

## Proposal

Data fields (`key=value`) and raw JSON fields (`key:=value`) now parse the `key` as [JSON form](LINK

Example:
```bash
$ http PUT pie.dev/put \
    'object=scalar' \                           # Object â€” blank key
    'object[0]=array 1' \                       # Object â€” "0" key
    'object[key]=key key' \                     # Object â€” "key" key
    'array:=1' \                                # Array â€” first item
    'array:=2' \                                # Array â€” second item
    'array[]:=3' \                              # Array â€” append (third item)
    'wow[such][deep][3][much][power][!]=Amaze'  # Nested object
```
```json
{
    "array": [
        1,
        2,
        3
    ],
    "object": {
        "": "scalar",
        "0": "array 1",
        "key": "key key"
    },
    "wow": {
        "such": {
            "deep": [
                null,
                null,
                null,
                {
                    "much": {
                        "power": {
                            "!": "Amaze"
                        }
                    }
                }
            ]
        }
    }
}
```

The new syntax is compatible with other JSON-specific syntax and can be mixed altogether.

---

Note: it is not doable to simply use the `jarg` module as it would install PyYAML, and we want to keep our requirements light. I also checked other modules like [html-json-forms](LINK but I prefer to ship our own code for the same reason: no new module to package. At the end, the new code is maintainable enough, and *quite* small.

In the first issue, #946  , we implemented a way so that the user can read the authentication data is  from a JSON file and does not need to manually fill in the authentication data.

In the second issue, #1007 , we implemented a new feature that allows the user to have the possibility to present the output message in a JSON format as follows:

```
{"Request":{
    "headers":{request headers},
    "body": {request body}
    },
  "Response":{
    "headers":{response headers},
    "body": {response body}
    }
}
```
